import React, { useEffect, useState } from "react";

const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(()=>{
    fetch('https://dummyjson.com/products/1').then((data)=>{
        data.json().then(result =>{
            console.log(result);
            setUser(result.data)
        })
    })
  },[])
  return (
    <>


            {
                user.map((item,index)=>
                <tr key={index}>
                    <td>{item.id}</td>
                    <td>{item.title }</td>
                    <td>{item.price}</td>
                    <td>{item.brand}</td>
                </tr>
                )
            }

    </>
  );
};

export default Api;
